window.bookSummaryJSON = "<p><i>Not Quite the Fairy Tale is a series of paranormal romance written for a mature audience. Expect adult language and naughty stuff. Each book is a stand-alone.</i></p> <p>Aurora Stephenson is the ultimate lady, the picture of grace and perfection. She’s distant, detached, and consequently, no one thinks she has a heart. </p> <p>They’re wrong. </p> <p>For years, she’s cared for, and cared about, one person beyond anyone else. Nevermind the fact that King Rupert isn’t exactly what one would call alive.</p> <p>He's slept for 100 years, and nothing can awake him...or so Aurora thinks.</p>"; 
